        "instructions": "Preheat oven to 350 degrees.\nToss apples with cinnamon and pumpkin pie spice.\nMelt butter in a saucepan and add in the apples.\nSimmer and cook until soft, about 15 minutes.\nRemove from heat and cool.\nMelt the caramel syrup in a saucepan over low heat.\nStir the chopped peanuts into the caramel syrup and remove from heat. Take cinnamon buns out of can and unroll each one on a cutting board. Mix the apples and peanuts together and place small teaspoon portion inside of the cinnamon roll, carefully rolling it back together as you go. Place the juice from the sauted apples on the bottom of a greased 13x9 inch pan.\nTake the cinnamon rolls and place them upside down in the pan.\nPut the rolls in the oven and bake them for 35 minutes or until dough is baked through fully.\nTake rolls out and immediately flip them on to another plate. Allow rolls to cool for 10 minutes.\nTake the icing from the cinnamon rolls package and melt it for 10 seconds in a microwave.\nUsing a fork, drizzle it over the top of each roll.\nTop rolls with Tropical Foods PB&J Mix.",
