        "instructions": "<ol><li>To make the tomato sauce: Place tomatoes, butter, onion, rosemary, thyme, and salt in a saucepan over medium heat.</li><li>Bring to simmer.</li><li>Reduce heat to low and continue simmering for 45 minutes.</li><li>Stir occasionally.</li><li>Remove from heat and take out the onion, and sprigs of rosemary and thyme.</li><li>Seth doesnt like chunks of tomato, so we use an immersion blender to puree the sauce.</li><li>Add crushed red pepper if desired.</li><li>I like doing this step the night before and refrigerating the sauce until I need it the next day.</li><li>To prepare the dip: Heat oven to 350.</li><li>In a baking dish, layer the arugula and place the slices of garlic over the arugula.</li><li>Put half the sauce over that.</li><li>Break the eggs into the sauce.</li><li>Cover with remaining sauce.</li><li>Sprinkle with parmesan cheese.</li><li>Bake for about 24 minutes.</li><li>The whites should be set, and the yolk should still be runny.</li><li>When done, scatter the basil on top.</li><li>We like to break the eggs as soon as the dip comes out of the oven to ensure they remain runny, and we mix it all together.</li><li>Baguette dippers: Brush the olive oil on baguette slices.</li><li>Sprinkle the salt, freshly ground black pepper, and Parmesan cheese.</li><li>Bake at 350 for 10 minutes.</li></ol>",
