        "instructions": "<ol><li>Shred 5 red skinned potatoes.</li><li>Squeeze all liquid out of red skinned potatoes in papertowel.</li><li>Place pan on med/high heat. Add a scoop of coconut oil to pan.</li><li>Add shredded potatoes to pan. Spread them out and flip when crispy. Set potatoes aside.</li><li>In another pan, add a scoop of coconut oil. Add 3 eggs. Scramble eggs until very close to done and remove from heat. Set aside.</li><li>Chop green pepper and tomato. Set aside.</li><li>Add ground beef to bowl. Add sage, sea salt, basil, white pepper, onion flakes and marjoram. Mix with hands thoroughly.</li><li>Roll out parchment paper.</li><li>Remove two small amounts of ground beef and roll into balls. Flatten balls onto parchment paper.</li><li>Stack small scoop of hashbrowns, eggs, green peppers, tomato, slice of goat cheese.</li><li>Place second ball on top of stack.</li><li>Pinch edges together to seal.</li><li>Pick up and begin forming into a ball in your hands releasing all of the air.</li><li>Continue steps 9-13 until all ground beef is used. (Approx 6 Balls).</li><li>Take paper towel and scoop small amount of coconut oil onto it. Wipe it all over flat pan.</li><li>Place ground beef balls onto pan.</li><li>Pre-heat oven to 350. Bake 15 minutes or until ground beef is cooked through.</li></ol>",
