        "instructions": "<ol><li>Fry up 4 strips of bacon and set aside.</li><li>Leave some of the bacon fat in the pan but remove from the eye.</li><li>Put all of the spices and sauces into the ground beef, mix well and form even patties.</li><li>Heat a large non-stick skillet until the pan (with some of the bacon fat in it) is hot. Place patties in hot pan and sear for 1 minute and 30 seconds each side. After searing the burgers, remove them from stove top and bake off in the oven at 415 degrees until it reaches your desired temperature (3-4 minutes).</li><li>While the burgers are in the oven, get your egg going. On the same hot eye where you did your burger, use a new non-stick pan for the eggs. On the two over easy eggs, grind 2 grinds of salt, 2 grinds of pepper and a dash of Tabasco onto each egg yolk.</li><li>Add the cheese on the burgers when the burgers have about 1 minute of cook time remaining, so the cheese melts.</li></ol>",
