            "pairingText": "Omelet can be paired with Sparkling Wine. Even if you aren't making mimosas, sparkling wine is great with eggs for two reasons. One, if you're eating eggs early in the day, sparkling wine has less alcohol. Secondly, it cleanses the palate, which is important since yolk is known to coat the palate. The Ruffino Prosecco with a 4.2 out of 5 star rating seems like a good match. It costs about 13 dollars per bottle.",
