                    "description": "Ruffino Prosecco has been produced from grapes grown in the hilly area of Valdobbiadene, which is the most historically vocated region for the production of Prosecco.Bright straw yellow with fine bubbles. The bouquet is fragrant and intensely fruity. It shows clean notes of apples, pears and citrus, accompanied by slight hints of hawthorn, wisteria and elder. Crisp, clean and delicate with fine bubble caressing. Intense sensations of apples and peaches drive a pleasant aftertaste, that is reminiscent of fruity and floral aromas.Ideal as an aperitif; it is very versatile as a food companion. Ruffino Prosecco perfectly matches with pizza, fish and shellfish dishes as well as white meat dishes.",
