            "pairingText": "Sparkling Wine are great choices for Omelet. Even if you aren't making mimosas, sparkling wine is great with eggs for two reasons. One, if you're eating eggs early in the day, sparkling wine has less alcohol. Secondly, it cleanses the palate, which is important since yolk is known to coat the palate. One wine you could try is Guillette-Brest, Brut Millesime. It has 5 out of 5 stars and a bottle costs about 44 dollars.",
